INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "あたしだって\nやるときはやるよ！", 1, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24001, 1, 0);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24002, 1, 1);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24003, 1, 2);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "やったね！\nこれでようやく\nサボれるよ…", 2, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24004, 2, 3);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24005, 1, 4);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24006, 2, 5);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "あたしも意外と\nやるもんでしょ？", 2, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24007, 2, 6);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24008, 4, 7);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24009, 4, 8);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "まじめに\nやったんだけどな…\n悔しいな～", 4, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24010, 4, 9);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "やられた…\nねずみって意外と\nてごわいね", 4, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24011, 4, 10);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 0.0, "リン", 24012, 4, 11);
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "疲れた…\nけど、次こそは\n守り抜くよ…", 4, 0.0, 10040, 0.0, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 102601, 1.81, "リン", 24013, 1, 12);
